INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (321, 2, 1, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 0, 125801, "リリ", 40011, 1, 24001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (322, 2, 1, 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 0, 126001, "クリア", 40011, 2, 24001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (323, 2, 1, 1, "んーと。\nこれ、あげる。\nはい", 0, 126101, "プレシア", 40011, 3, 24001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (324, 2, 2, 1, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 0, 125801, "リリ", 40011, 4, 24001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (325, 2, 2, 1, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 0, 126001, "クリア", 40011, 5, 24001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (326, 2, 2, 1, "お兄。\nきてくれて、うれしい", 0, 126101, "プレシア", 40011, 6, 24001);
